import './CreateEvent.css';
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';   

const CreateEvent = () => {
  const navigate = useNavigate();
  const [values, setValues] = useState({
    title: '',
    description: '',
    photo: '',
    date: '',  
    startTime: '',
    endTime: '',
  });

  const handleChange = (event) => {
    setValues({ ...values, [event.target.name]: event.target.value });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log('Submitting values:', values);  // Debugging log
    
  return (
    <div className="createPage">
      <div className='createBox'>
        <form className='infoFill'>
        <div className='leftBox'>
          <button className='eventImageUpload' type='text'>upload image</button>
          <br />
          <input className='eventNameUpload' type='text' placeholder="Event title..."/>
          <br />
          <input className='eventDescriptionUpload' type='text' placeholder="Event description..."/>
        </div>
        <div className='rightBox'>
            <div className='trackingInput'>
              <div className='dateInput'>
                <input className='monthInput'/>
              </div>
              <div className='timeInput'>
                <input className='timeInputStart'/>
                <input className='timeInputEnd'/>
              </div>
            </div>
            <div className='filterInput'>
              idk what to do for this tbh
            </div>
            <button className='postEvent'>Post Event!</button>   
        </div>
        </form>
      </div>
    </div>
  );
}
};

export default CreateEvent;
